import axios from "axios";

const ListItem = {
    items:{
        card:[],
        bag:[]
    }
}


export const GetItem = (category) => ({
    type: 'GET',
    payload:category
})

export const GetItemAPI = async (dispatch,category) =>{
    console.log(category)
    dispatch(GetItem(category))
}






const reducer = async (state = ListItem , action) => {
    switch(action.type){
        case 'GET':
            if(category === "card"){

                return{
                    ...state,
                }
            }else if(category === "bag"){
                const listData = axios.get("/bag")
                return{
                    ...state,
                }
            }

        default:
            return state;
    }
}

export default reducer;
